import React from 'react';
import { motion } from 'framer-motion';

export default function Cars() {
    return (
        <motion.div
            style={{
                display: 'flex',
                justifyContent: 'space-around',
                alignItems: 'center',
                height: '100vh',
                backgroundColor: '#f0f0f0',
            }}
        >
            {/* Premier conteneur */}
            <motion.div
                initial={{ y: 200 }}
                animate={{ y: 0 }}
                transition={{
                    duration: 1.5,
                    ease: 'easeInOut',
                }}
                style={{
                    width: '200px',
                    height: '300px',
                    backgroundColor: '#ffffff',
                    borderRadius: '15px',
                    overflow: 'hidden',
                    boxShadow: '0 4px 10px rgba(0, 0, 0, 0.2)',
                }}
            >
                <img
                    src="https://i.pinimg.com/originals/94/c9/c4/94c9c441c8a3153650dd2f9b503cd7a4.jpg" // Image de Luffy
                    alt="Luffy"
                    style={{
                        width: '100%',
                        height: '100%',
                        objectFit: 'cover',
                    }}
                />
            </motion.div>

            {/* Deuxi√®me conteneur */}
            <motion.div
                initial={{ y: 200 }}
                animate={{ y: 0 }}
                transition={{
                    duration: 1.5,
                    ease: 'easeInOut',
                    delay: 0.3,
                }}
                style={{
                    width: '200px',
                    height: '300px',
                    backgroundColor: '#ffffff',
                    borderRadius: '15px',
                    overflow: 'hidden',
                    boxShadow: '0 4px 10px rgba(0, 0, 0, 0.2)',
                }}
            >
                <img
                    src="https://i.pinimg.com/originals/21/99/f2/2199f29d77f267cf5453a88237e94b3f.jpg" // Image de Zoro
                    alt="Zoro"
                    style={{
                        width: '100%',
                        height: '100%',
                        objectFit: 'cover',
                    }}
                />
            </motion.div>
        </motion.div>
    );
}
